import './ChooseExrcise.css';
import React, { useState } from 'react';
import Form from "./Components/Form";
import ExerciseList from "./Components/ExerciseList";
import Timer from './Components/Timer';

// import ReactDOM from 'react-dom';
function ChooseExrcise(props) {
  //const {trainingtime} = props.location.state
  const [inputText, setInputText] = useState("");
  const [Exercises, setExercises] = useState([
    { name: "Plank-ups", time: 10, repeats: 2, restTime: 10, id:"123" },
    { name: "Dirty Dog", time: 30, repeats: 1, restTime: 10, id:"456" },
    { name: "Crunch", time: 60, repeats: 2, restTime: 10, id:"789" }
  ]);
 //console.log(this.props.params);
  return (
    <div className="App">
      <header>
        <h1> Hi you! choose your exercise:  </h1>
      </header>
      <div>
      <Form
        setInputText={setInputText} 
        Exercises={Exercises}
        setExercises={setExercises}
        inputText={inputText}
        />  
      </div>
      <div> 
        <ExerciseList  
          Exercises={Exercises}
          setExercises={setExercises}
        />
      </div>
    </div>   
  );
};

export default ChooseExrcise;
